      // פוקנציה שמחזירה למשחק
      function backTogame(e) {
        var bgGame = stage.getChildByName("bgGame1");
        if (
          e.currentTarget.name == "EndingW" ||
          e.currentTarget.name == "NewChoise"
        ) {
          //אם לחצו שחק שוב או לקטגרויות במסך הסיום
          // אז פה יהיה פקודות שיעבדו לשתיהם
          stage.removeChild(stage.getChildByName("EndWind")); //מסך הסיום יעלם
          countMisihim = 0;
          timeQ = timeForQ; // הזמן יחזור ל30 שניות
          countQ = 0; // מספר השאלות שנענו נכון יחזרו ל0
          TotalTime = 0; // משתנה הסופר את כל הזמן יחזור ל0
          for (let i = 0; i < ga2.length; i++) {
            // לולאה שעוברת על המערך ומחזירה את כל השאלות לfalse
            ga2[i][1][1] = false; // מכוון ובמשחק הקודם הפכנו אותם ל true
            ga2[i][0][1] = 1;
          }
          if (e.currentTarget.name == "EndingW") {
            // אם זה שחק שוב - אז יופעל פה כל ההגדרות
            NumQuest = ga2.length; // המשתנה יכיל בחזרה את אורך המערך בנושא הנבחר
            startGame(); // הפעלת פונקציה של העלת סימבול המשחק
            Questions(); // הפעלת פונקציה להעלאת שאלות
          } else {
            // אם זה לא שחק שוב כלומר חזרה לקטגוריות- אז יופעל ההגדרות האלן
            comboStart(); // תופעל הפונקציה הזו שמעלה את מסך הקומבו
          }
        } else {
          // אם לא לחצנו על הכפתורים במסך הסיום
          if (NumQuest != 0) {
            // תבדוק האם המשתנה אינו שווה לאפס - משתנה זה מכיל את אורך המערך בנושא הנבחר
            bgGame.TopQ.buttonpaused.addEventListener("click", pausedFunc); // מוסיף מאזים לכפתור השהייה
            bgGame.TopQ["wherenumQuestion"].visible = true; // תיבת טקסט של מד ההתקדמות יופיע
            for (let i = 0; i < ga2[qNum].length - 2; i++) {
              // לולאה שעוברת על כל הדובונים
              var currentBear = bgGame.getChildByName("bear" + i);
              currentBear.visible = true; // והופכת אותם לנראים
            }
            if (
              e.currentTarget.name == "nBtn" ||
              e.currentTarget.name == "BtninWTO"
            ) {
              //אם מה שנלחץ הוא כפתור המשך שנמצא בחלונית נגמר הזמן או כפתור המשך שמופיע אחרי כל שאלה במהלך המשחק
              timeQ = timeForQ; // יוחזר הזמן ל30 שניות
              bgGame.removeChild(bgGame.getChildByName("windowTimeout")); // הסרה של חלון נגמר הזמן
              nextQ(); // פונקציה שמעלה שאלה הבאה וגם בודקת אם לא נגמר השאלות
              bgGame
                .getChildByName("bear" + yaditMove)
                .removeChild(
                  bgGame.getChildByName("bear" + yaditMove).getChildByName("vi")
                ); // מחיקה של משוב להצלחה
              bgGame.yadit.x = bgGame.getChildByName("bear0").x; // הידית תועבר למיקום של הדובי הראשון
              bgGame.removeChild(bgGame.getChildByName("nBtn")); // ימחק כפתור המשך מסימבול המשחק
            } else {
              // אם זה לא זה ולא זה
              // כלומר, מסך השהייה שלא נתנו לו שם אז הוא יהיה null
              bgGame.removeChild(bgGame.getChildByName("Puse")); // אז ימחק מסך ההשהיה
              bgGame.TopQ.Question.text = ga2[qNum][1][0]; // הטקסט של השאלה יוצג
              if (ga2[qNum][1][2] != "False") {
                // אם יש תמונה בגזע שאלה
                bgGame.getChildByName("inQpic").visible = true; // התמונה תיהיה נראית לעין
                bgGame.getChildByName("mee" + 9).visible = true;
              }
            }
            bgGame.TopQ.buttonpaused.visible = true; // כפתור השהייה יהיה נראה לעין
            bgGame.TopQ.buttonsound.visible = true;
            if (timeQ != "ללא הגבלה") {
              timer(); // פונקצית זמן תופעל
              mytime = setInterval(timer, 1000); // האינטרוול של הזמן ירוץ
            } else {
              bgGame.TopQ["timeforQuestion"].text = "";
              bgGame.TopQ.buttonpaused.visible = false;
              bgGame.TopQ.buttonsound.visible = false;
            }
            window.addEventListener("keydown", keypressFunc); // תיהיה למשתמש שוב אפשרות להשתמש בחיצים
          } else {
            // אם המשתנה שסופר את אורך המערך שווה ל0 כלומר העלאת סוף משחק
            clearInterval(mytime); // הזמן יפסק
            stage.removeChild(bgGame); // ימחק סימבול המשחק מהבמה
            var FAnimation = new lib.FinishAnimation(); // יצירת אנימצית סיום
            FAnimation.x = middleX;
            FAnimation.y = middleY;
            stage.addChild(FAnimation); // הוספה לבמה
            setTimeout(function () {
              // יופעל פונקציה אנונימית שאחרי 8 שניות תסיים את האנימציה ותפעיל פונקציה למסך סיום
              Ending();
              stage.removeChild(FAnimation);
            }, 8000);
          }
        }
      }
